  `name` varchar(20) NOT NULL COMMENT '公司名称',
  `type` int(2) NOT NULL DEFAULT '0' COMMENT '行业类型 0-默认 1-汽车制造 2-白色家电',
  `location` int(2) NOT NULL COMMENT '归属市场',
  `category` int(2) NOT NULL DEFAULT '1' COMMENT '类型 1-股票 2-基金 3-Reits 4-可转债 5-逆回购',
  `total_equity` bigint(20) NOT NULL COMMENT '现总股本',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `sort` int(3) NOT NULL DEFAULT '0' COMMENT '排序',
  `target_level` int(3) NOT NULL DEFAULT '0' COMMENT '指标级别',
  `mission` varchar(200) DEFAULT NULL COMMENT '使命',
  `vision` varchar(500) DEFAULT NULL COMMENT '愿景',
  `core_values` varchar(1000) DEFAULT NULL COMMENT '核心价值观',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_code` (`code`) USING BTREE
