DROP TABLE IF EXISTS `organization_have`;
CREATE TABLE `organization_have` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `organization` varchar(20) NOT NULL COMMENT '机构名称',
  `code` varchar(20) NOT NULL COMMENT '股票代码',
  `name` varchar(20) NOT NULL COMMENT '股票名称',
  `price` decimal(20,2) NOT NULL COMMENT '买入价格',
  `state` int(1) NOT NULL COMMENT '0-未持股 1-持股',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
